import React from 'react';

const infoBar = () => {
  return (
    <div className='infoBar'>
        <div className='leftInnerContainer'>
            <img className='onlineIcon' scr='./icons/onlineIcon.png' />
            <h3>Room</h3>
        </div>
        <div className='rightInnerContainer'>
            <a href='/'><img src='./icons/closeIcon.png' alt='close image' /></a>
        </div>
    </div>
  )
}

export default infoBar;
